import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';  // Add this if you have a CSS file
import App from './App';  // Import your main App component

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
